func beautifulSubstrings(s string, k int) int64 {
    vowels := map[rune]bool{'a': true, 'e': true, 'i': true, 'o': true, 'u': true}
    n := len(s)
    var count int64 = 0

    for i := 0; i < n; i++ {
        vowelCount, consonantCount := 0, 0
        for j := i; j < n; j++ {
            if vowels[rune(s[j])] {
                vowelCount++
            } else {
                consonantCount++
            }

            if vowelCount == consonantCount && (vowelCount*consonantCount)%k == 0 {
                count++
            }
        }
    }

    return count
}
